import React, {useState, useEffect} from 'react';
import styled from "styled-components";
import axios from 'axios';
import 'antd/dist/antd.css';
import { Tabs, Button } from 'antd';
import ReactDOM from 'react-dom';
import 'antd/dist/antd.css';
import '../index.css';
import '../App.css';

const { TabPane } = Tabs;

const Head = styled.div`
    background-color:#A352CC;
    height:60px;
    text-align:center;
    color:#ffffff;
    display:flex;
    justify-content:center;
    align-items:center;
    font-weight:bold;
    font-size:16px; 
`;
const TabBar = styled(Tabs)`


// .ant-tabs-tab.ant-tabs-tab-active.ant-tabs-ink-bar.ant-tabs-ink-bar-animated {
//   width:20px;
// }
// .ant-tabs.ant-tabs-top .ant-tabs-centered .sc-JsfZP .hysmfv{
//   width:20px;
// }
.ant-tabs-ink-bar {
 
  width:1000px;
}
.ant-tabs-tab-btn{
  width:45vw;
  text-align:center;
}
.ant-tabs-ink-bar.ant-tabs-ink-bar-animated{
  width:100%;
  height:10px;
}
`;
const FindAccount=()=>{
    const callback=(key)=> {
        console.log(key);
      };
      
    return(
        <>
        <Head>아이디/비밀번호 찾기</Head>
    <TabBar centered defaultActiveKey="1" onChange={callback}>
    <TabPane tab="아이디 찾기" key="1">
     아이디 찾기 칸
    </TabPane>
    <TabPane tab="비밀번호 찾기" key="2">
      비밀번호 찾기 칸
    </TabPane>
  </TabBar>
        </>
    );

};

export default FindAccount;
